<!doctypehtml>
    <html lang=en-us style=overflow:hidden>

    <head>
        <meta charset=utf-8>
        <meta content="text/html; charset=utf-8" http-equiv=Content-Type>
        <title>Zigxel</title>
        <link href=xterm/xterm.css rel=stylesheet>
        <script src=xterm/xterm.js></script>
        <style>
            body {
                padding: 0;
                margin: 0
            }

            .emscripten {
                padding-right: 0;
                margin-left: auto;
                margin-right: auto;
                display: block
            }

            textarea.emscripten {
                font-family: monospace;
                width: 80%;
                height: 100%
            }

            div.emscripten {
                text-align: center
            }

            div.emscripten_border {
                border: 1px solid #000;
                display: none
            }

            canvas.emscripten {
                display: none;
                border: 0 none;
                background-color: #000
            }

            #output-container {
                position: relative;
                width: 780px;
                height: 550px
            }

            #output {
                position: absolute;
                top: 0;
                left: 0;
                width: 100%;
                height: 100%
            }

            #output-overlay {
                position: absolute;
                z-index: 9;
                top: 0;
                left: 0;
                width: 100%;
                height: 100%
            }

            .spinner {
                height: 50px;
                width: 50px;
                margin: 0 auto;
                -webkit-animation: rotation .8s linear infinite;
                -moz-animation: rotation .8s linear infinite;
                -o-animation: rotation .8s linear infinite;
                animation: rotation .8s linear infinite;
                border-left: 10px solid #0096f0;
                border-right: 10px solid #0096f0;
                border-bottom: 10px solid #0096f0;
                border-top: 10px solid #6400c8;
                border-radius: 100%;
                background-color: #c864fa
            }

            @-webkit-keyframes rotation {
                from {
                    -webkit-transform: rotate(0)
                }

                to {
                    -webkit-transform: rotate(360deg)
                }
            }

            @-moz-keyframes rotation {
                from {
                    -moz-transform: rotate(0)
                }

                to {
                    -moz-transform: rotate(360deg)
                }
            }

            @-o-keyframes rotation {
                from {
                    -o-transform: rotate(0)
                }

                to {
                    -o-transform: rotate(360deg)
                }
            }

            @keyframes rotation {
                from {
                    transform: rotate(0)
                }

                to {
                    transform: rotate(360deg)
                }
            }
        </style>
    </head>

    <body>
        <div id=emscripten-container>
            <figure id=spinner style=overflow:visible>
                <div class=spinner></div>
                <center style=margin-top:.5em><strong>emscripten</strong></center>
            </figure>
            <div id=status class=emscripten>Downloading...</div>
            <div class=emscripten><progress hidden id=progress max=100 value=0></progress></div>
            <div class=emscripten_border><canvas class=emscripten id=canvas oncontextmenu=event.preventDefault()
                    tabindex=-1></canvas></div>Click/Touch to drop pixels, mouse scroll/ two touch to change which
            pixels to drop.<div id=output-container>
                <div id=output></div>
                <div id=output-overlay></div>
            </div>
